import React from 'react'
import Search from '../Search/Search';


const RResources = ()=>{

    const items = ['MENU', "MenuCategory", 'TABLE_', 'DISH'].map(
            (key)=>{
                return(
                    <Search table={key} ></Search>
                )
        }
    )


    return(
        <div>
            <hr />
                {items}
            <hr />
        </div>
    )
}

export default RResources;
